import React from 'react'

const TextSection = () => {
  return (
    <div className='container text-section'>
      <h1>Text Section</h1>
      <div className="text-section-grid">
        <div className="text-section-text"></div>
        <div className="text-section-img"></div>
      </div>
    </div>
  )
}

export default TextSection
